import React from 'react';
import {} from 'react-bootstrap';
import { Link } from 'react-router-dom';
import '../style.css';

import Header from '../components/Header';

const Homepage = () => (
	<div className="center-text">
		<Header />
		<div className="after-heading hero-img">
			<div className="my-container" style={styles.heroContainer}>
				<div className="my-container column-dir center">
					<h1>Anna</h1>
					<h1>Zhang</h1>
				</div>
			</div>
			<h1>hello</h1>
		</div>
	</div>
);

const styles = {
	heroContainer: {
		width: '100%',
		padding: '50px'
	}
};

export default Homepage;
